import React from 'react';
import {Delete} from '@material-ui/icons';
import {Container} from '@material-ui/core';
import {Link} from 'react-router-dom';

class PageLayout extends React.Component {
  render() {
    const menus = [
      { text: 'events', icon: <Delete />, link: '/events' },
      { text: 'stations', icon: <Delete />, link: '/stations' },
      {
        text: 'accounts',
        icon: <Delete />,
        link: '/accounts',
      },
    ];
    return (
        <Container fixed>
          <div className='twoesys-pageLayout__navBar'>
            <image className='twoesys-pageLayout__logo' src='assets/image/logo.jpg'/>
            {menus.map(menuItem => (
              <Link to={menuItem.link}>{menuItem.icon}{menuItem.text}</Link>
            ))}
          </div>
          <div className={'twoesys-pageLayout__pageBody'}>
            {this.props.children}
          </div>
        </Container>
    );
  }
}

export default PageLayout;
